{"answer": "**Step 1 – Find the amount of blood in one shark**

A shark has three times as much blood as a whale.

\[
\text{Blood per shark} = 3 \times \text{Blood per whale}
\]

\[
\text{Blood per shark} = 3 \times \boxed{40} \text{ gallons}
\]

\[
\text{Blood per shark} = \boxed{120} \text{ gallons}
\]

**Step 2 – Find the total amount of blood in ten sharks**

\[
\text{Total blood} = 10 \times \text{Blood per shark}
\]

\[
\text{Total blood} = 10 \times \boxed{120} \text{ gallons}
\]

\[
\text{Total blood} = \boxed{1200} \text{ gallons}
\]

#### 1200"}

